import math
def is_prime(n):
    if n % 2 == 0 and n > 2:
        return False
    return all(n % i for i in range(3, int(math.sqrt(n)) + 1, 2))
def dec_to_bin(x):
    return (bin(x)[2:])
fib = [1,1]
for i in range(100):
    fib.append(fib[-1] + fib[-2])
for a in fib[3:]:
    b = dec_to_bin(a)
    c = b[::-1]
